// 現在のページを取得する。
var page = Forguncy.Page;

// 物件名セルを取得する。
var temp = page.getCell("物件名").getValue();
// NFKC変換
var normalized = temp.normalize("NFC");
// 変換値をセットする
page.getCell("物件名").setValue(normalized);

// 市区郡名セルを取得する。
var temp = page.getCell("市区郡名").getValue();
// NFKC変換
var normalized = temp.normalize("NFKC");
// 変換値をセットする
page.getCell("市区郡名").setValue(normalized);

// 町名番地セルを取得する。
var temp = page.getCell("町名番地").getValue();
// NFKC変換
var normalized = temp.normalize("NFKC");
// 変換値をセットする
page.getCell("町名番地").setValue(normalized);
